window.bookSummaryJSON = "<p><b>Geek + runway = a runaway UK hit!&nbsp;</b></p> <p><b><i>Geek Girl </i></b><b>is the first book in a hilarious, internationally best-selling series that's perfect for fans of Morgan Matson and Julie Buxbaum. </b></p> <p>Harriet Manners is a geek. She always has been, and she thought she always would be - but when she's discovered by a modeling agent, she leaps at the chance to reinvent herself.&nbsp;</p> <p>There's only one problem: Harriet is the definition of awkward. Can she transform from geek to chic?&nbsp;</p> <p>Includes a sneak peak at <i>Geek Girl: Model Misfit</i>!&nbsp;</p>"; 
